INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106001, 7001, 0, -363.0, 1, "キャル", 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 7002, 0, -363.0, 1, "コッコロ", 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105801, 7003, 0, -363.0, 1, "ペコリーヌ", 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105801, 10001, 0, -363.0, 1, "ペコリーヌ", 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106001, 10002, 0, -363.0, 1, "キャル", 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 10003, 0, -363.0, 1, "コッコロ", 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106401, 10004, 0, -363.0, 2, "シェフィ", 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10, 0.0, 0.0, 1, 2104010);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105801, 12001, 0, -416.5, 1, "ペコリーヌ", 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106001, 13001, 0, -363.0, 1, "キャル", 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 13002, 0, -363.0, 1, "コッコロ", 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106401, 13003, 0, -363.0, 2, "シェフィ", 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, 0.0, 0.0, 1, 2104010);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105801, 13004, 0, -363.0, 1, "ペコリーヌ", 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 14001, 0, -363.0, 1, "コッコロ", 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106401, 14002, 0, -363.0, 2, "シェフィ", 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14, 0.0, 0.0, 1, 2104010);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105801, 14003, 0, -363.0, 1, "ペコリーヌ", 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106001, 14004, 0, -363.0, 1, "キャル", 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 15001, 0, -470.0, 1, "コッコロ", 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106401, 16001, 0, -363.0, 2, "シェフィ", 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16, 0.0, 0.0, 1, 2104010);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105801, 16002, 0, -363.0, 1, "ペコリーヌ", 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106001, 16003, 0, -363.0, 1, "キャル", 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 16004, 0, -363.0, 1, "コッコロ", 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 17002, 0, -363.0, 1, "コッコロ", 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106001, 17004, 0, -363.0, 1, "キャル", 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 25, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 17005, 0, -363.0, 1, "コッコロ", 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 25, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106401, 17006, 0, -363.0, 2, "シェフィ", 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 25, 0.0, 0.0, 1, 2104010);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105801, 17007, 0, -363.0, 1, "ペコリーヌ", 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 25, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 18001, 0, -363.0, 1, "カリン", 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 18002, 0, -363.0, 1, "カリン", 2, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 19001, 0, -470.0, 1, "カリン", 3, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 19002, 0, -470.0, 1, "カリン", 4, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 20001, 0, -470.0, 1, "カリン", 5, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 20002, 0, -470.0, 1, "カリン", 6, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106001, 21001, 0, -363.0, 1, "キャル", 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105901, 21002, 0, -363.0, 1, "コッコロ", 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106401, 21003, 0, -363.0, 2, "シェフィ", 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21, 0.0, 0.0, 1, 2104010);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 105801, 21004, 0, -363.0, 1, "ペコリーヌ", 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 22001, 0, -430.0, 1, "カリン", 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 22002, 0, -430.0, 1, "カリン", 2, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 23001, 0, -430.0, 1, "カリン", 3, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 190801, 23002, 0, -430.0, 1, "カリン", 4, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109001, 24001, 10011, -385.0, 1, "エリコ（バレンタイン）", 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 8.0, 4.08, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109001, 24002, 10011, -385.0, 1, "エリコ（バレンタイン）", 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 8.0, 5.0, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109001, 24003, 10011, -385.0, 1, "エリコ（バレンタイン）", 3, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 8.0, 10.11, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109001, 24004, 10011, -385.0, 1, "エリコ（バレンタイン）", 4, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 8.0, 4.0, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109001, 24005, 10011, -385.0, 1, "エリコ（バレンタイン）", 5, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 8.0, 6.0, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109002, 24006, 10011, 0.0, 1, "エリコ（バレンタイン）", 6, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109002, 24007, 10011, 0.0, 1, "エリコ（バレンタイン）", 7, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109002, 24008, 10011, 0.0, 1, "エリコ（バレンタイン）", 8, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109002, 24009, 10011, 0.0, 1, "エリコ（バレンタイン）", 9, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109002, 24010, 10011, 0.0, 1, "エリコ（バレンタイン）", 10, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109101, 24011, 10011, -385.0, 1, "シズル（バレンタイン）", 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 8.0, 2.12, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109101, 24012, 10011, -385.0, 5, "シズル（バレンタイン）", 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 8.0, 4.19, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109101, 24013, 10011, -385.0, 2, "シズル（バレンタイン）", 3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24, 8.0, 2.3, 4, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109102, 24014, 10011, 0.0, 1, "シズル（バレンタイン）", 4, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109101, 24015, 10011, -385.0, 5, "シズル（バレンタイン）", 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24, 8.0, 5.23, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109102, 24016, 10011, 0.0, 1, "シズル（バレンタイン）", 6, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109101, 24017, 10011, -385.0, 1, "シズル（バレンタイン）", 7, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24, 8.0, 5.01, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109102, 24018, 10011, 0.0, 1, "シズル（バレンタイン）", 8, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109102, 24019, 10011, 0.0, 1, "シズル（バレンタイン）", 9, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2019/01/31 12:00:00", "2030/12/17 14:59:59", 109102, 24020, 10011, 0.0, 1, "シズル（バレンタイン）", 10, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106401, 26001, 0, -363.0, 2, "シェフィ", 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26, 0.0, 0.0, 1, 2104010);
