INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 106001, 26003, 0, -363.0, 1, "キャル", 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 26, 0.0, 0.0, 1, 0);
