INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 123001, 43005, 0, -416.5, 1, "アメス", 2, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 44, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 123001, 43006, 0, -416.5, 1, "アメス", 3, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 45, 0.0, 5.79, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 123001, 46001, 0, -371.5, 1, "アメス", 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46, 0.0, 0.0, 1, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 104901, 47001, 0, -416.5, 2, "シズル", 1, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47, 0.0, 0.0, 2, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("2015/12/17 15:00:00", "2030/12/17 14:59:59", 101101, 47002, 0, -416.5, 1, "リノ", 1, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 47, 0.0, 9.32, 2, 0);
